import { useState } from "react";

const defaultFormFields = {
    displayName: '',
    email: '',
    password: '',
    confirmPassowrd:''
}
const SignUpForm = () => {
    const [formFields, setFormFields] = useState(defaultFormFields);
    const {displayName, email, password, confirmPassword} = formFields;

    const handleChange = (event) => {
        const {name} = event;
    };
    
    return(
        <div>
            <h1>
                Sign up with your email and password
            </h1>
            <form onSubmit={() => {}}>
                <label>Display name</label>
                <input type="text" require onChange={handleChange} name="displayName" value={displayName}/>

                <label>Email</label>
                <input type="email" require onChange={handleChange} name="email" value={email}/>

                <label>Password</label>
                <input type="password" require onChange={handleChange} name="password" value={password}/>

                <label>Confirm Password</label>
                <input type="password" require onChange={handleChange} name="confirmPassword" value={confirmPassword}/>
                <button type="submit">Sign Up</button>
            </form>
        </div>
    )
}

export default SignUpForm;
